import React from "react";
import Products from "./Products";

const Home = () => {
    return (
        <div className="hero">
            <div class="card text-white bg-dark p6" >
                <div class="card-body d-flex flex-column justify-content-center">
                    <div className="container">
                        <h5 class="card-title ">Bienvenido a la tienda virtual</h5>
                        <p class="card-text">Prueba tecnica</p>
                    </div>
                </div>
            </div>

            <Products />
        </div>

    );
}

export default Home;
